import React from "react";
import {Helmet} from "react-helmet";


function shoptalk(props) {

  return (

    <div className="postphoto">
          <Helmet>
                <style>{'body { background-color: #125a31; }'}</style>
          </Helmet>

          <div class="container">
  
        </div>

    </div>

  );
  
}

export default shoptalk;
